import React from 'react';

function Navbar(){
    return (
        <div className = "navbar">
            <img src = "#"/>
            <div className = "navItems">
                <a href = "#">Home</a>
                <a href = "#">Products</a>
                <a href = "#">About Us</a>
                <a href = "#">Contact Us</a>
            </div>
        </div>
    );
}

export default Navbar;
